--
-- Table structure for table `patients_info`
--

CREATE TABLE `patients_info` (
  `id` varchar(10) NOT NULL COMMENT 'รหัสผู้ป่วย (Primary Key)',
  `hn` varchar(20) DEFAULT NULL COMMENT 'เลข HN ของผู้ป่วย',
  `id_card` varchar(13) DEFAULT NULL COMMENT 'เลขบัตรประชาชนของผู้ป่วย',
  `first_name` varchar(50) DEFAULT NULL COMMENT 'ชื่อจริงของผู้ป่วย',
  `last_name` varchar(50) DEFAULT NULL COMMENT 'นามสกุลของผู้ป่วย',
  `address` varchar(255) DEFAULT NULL COMMENT 'ที่อยู่ของผู้ป่วย',
  `city` varchar(100) DEFAULT NULL COMMENT 'จังหวัดของที่อยู่',
  `sub_district` varchar(100) DEFAULT NULL COMMENT 'ตำบลของที่อยู่',
  `district` varchar(100) DEFAULT NULL COMMENT 'อำเภอของที่อยู่',
  `postal_code` varchar(10) DEFAULT NULL COMMENT 'รหัสไปรษณีย์',
  `phone_number` varchar(10) DEFAULT NULL COMMENT 'เบอร์โทรศัพท์ของผู้ป่วย',
  `emer_contact_name` varchar(255) DEFAULT NULL COMMENT 'ชื่อบุคคลที่ติดต่อฉุกเฉิน',
  `emer_contact_phone` varchar(255) DEFAULT NULL COMMENT 'เบอร์โทรบุคคลที่ติดต่อฉุกเฉิน',
  `date_of_birth` date DEFAULT NULL COMMENT 'วันเดือนปีเกิดของผู้ป่วย',
  `age` int(11) DEFAULT NULL COMMENT 'อายุของผู้ป่วย',
  `gender` enum('male','female','other') DEFAULT NULL COMMENT 'เพศของผู้ป่วย',
  `appointment_type` enum('Walk-in','Pre-booking') DEFAULT NULL COMMENT 'ประเภทการนัดหมาย (Walk-in หรือ จองล่วงหน้า)',
  `weight` float DEFAULT NULL COMMENT 'น้ำหนักของผู้ป่วย (kg)',
  `height` float DEFAULT NULL COMMENT 'ส่วนสูงของผู้ป่วย (cm)',
  `bmi` float DEFAULT NULL COMMENT 'ค่าดัชนีมวลกาย (BMI)',
  `blood_type` enum('A','B','AB','O') DEFAULT NULL COMMENT 'กรุ๊ปเลือดของผู้ป่วย',
  `temperature` float DEFAULT NULL COMMENT 'อุณหภูมิร่างกาย (°C)',
  `heart_rate` int(11) DEFAULT NULL COMMENT 'อัตราการเต้นของหัวใจ (BPM)',
  `blood_pressure` varchar(10) DEFAULT NULL COMMENT 'ค่าความดันโลหิต',
  `symptom_days` int(11) DEFAULT NULL COMMENT 'จำนวนวันที่มีอาการป่วย',
  `smoking` enum('Yes','No') DEFAULT NULL COMMENT 'ผู้ป่วยสูบบุหรี่หรือไม่',
  `alcohol` enum('Yes','No') DEFAULT NULL COMMENT 'ผู้ป่วยดื่มแอลกอฮอล์หรือไม่',
  `drug_allergy` enum('Yes','No') DEFAULT NULL COMMENT 'ผู้ป่วยแพ้ยาใช่หรือไม่',
  `allergy_details` text DEFAULT NULL COMMENT 'รายละเอียดอาการแพ้ยา',
  `additional_details` text DEFAULT NULL COMMENT 'รายละเอียดเพิ่มเติมเกี่ยวกับผู้ป่วย',
  `department` varchar(50) DEFAULT NULL COMMENT 'แผนกที่ผู้ป่วยเข้ารับการรักษา',
  `status` enum('Pending','Checked','Completed') DEFAULT NULL COMMENT 'สถานะของผู้ป่วย (รอดำเนินการ, ตรวจแล้ว, เสร็จสิ้น)',
  `urgency` enum('Normal','Urgent') DEFAULT NULL COMMENT 'ระดับความเร่งด่วนของผู้ป่วย',
  `created_at` datetime DEFAULT NULL COMMENT 'วันที่สร้างรายการ',
  `updated_at` datetime DEFAULT NULL COMMENT 'วันที่อัปเดตรายการล่าสุด'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='ตารางจัดเก็บข้อมูลผู้ป่วย';

