--
-- Table structure for table `patients_login`
--

CREATE TABLE `patients_login` (
  `id` varchar(10) DEFAULT NULL COMMENT 'รหัสบัญชีผู้ใช้ (Index)',
  `id_card` varchar(13) NOT NULL COMMENT 'เลขบัตรประชาชนของผู้ใช้ (Primary Key)',
  `username` varchar(13) DEFAULT NULL COMMENT 'ชื่อผู้ใช้ (ใช้เลขบัตรประชาชน)',
  `password` varchar(10) DEFAULT NULL COMMENT 'รหัสผ่านของผู้ใช้ (ใช้วันเดือนปีเกิดรูปแบบ ddmmyy)',
  `accepted_terms` tinyint(1) DEFAULT NULL COMMENT 'ยอมรับเงื่อนไขการใช้งาน (0 = ไม่ยอมรับ, 1 = ยอมรับ)',
  `pin_code` varchar(255) DEFAULT NULL COMMENT 'รหัส PIN สำหรับการเข้าถึงบัญชี',
  `profile_picture` longblob DEFAULT NULL,
  `fcm_token` varchar(255) DEFAULT NULL COMMENT 'โทเค็นสำหรับการแจ้งเตือนผ่าน Firebase Cloud Messaging',
  `created_at` datetime DEFAULT NULL COMMENT 'วันที่สร้างบัญชีผู้ใช้',
  `updated_at` datetime DEFAULT NULL COMMENT 'วันที่อัปเดตบัญชีล่าสุด'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='ตารางเก็บข้อมูลบัญชีผู้ใช้ของผู้ป่วย';

